const state = {
  allUsers: [
    { userId: 'hoza123', password: '123', name: 'Hoza', address: 'Seoul', src: "data:image/png;base64," },
    { userId: 'max123', password: '456', name: 'Max', address: 'Berlin', src: "data:image/png;base64," },
    { userId: 'lego123', password: '789', name: 'Lego', address: 'Busan', src: "data:image/png;base64," }
  ],
};

const getters = {
  allUsersCount: (state) => {
    return state.allUsers.length;
  },
  countOfSeoul: (state) => {
    let count = 0;
    state.allUsers.forEach((user) => {
      if (user.address === "Seoul") {
        count++;
      }
    });
    return count;
  },
  percentOfSeoul: (state, getters) => {
    return Math.round((getters.countOfSeoul / getters.allUsersCount) * 100);
  },
};

const actions = {
  addUsers: ({ commit }, payload) => {
    commit("addUsers", payload);
  },
};

const mutations = {
  addUsers: (state, payload) => {
    state.allUsers.push(payload);
  },
};

export default {
  namespaced: true,
  state,
  getters,
  actions,
  mutations
};
